private static long[] parseTimeStamps(String[] strs) {
  if (null == strs) {
    return null;
  }
  long[] result = new long[strs.length];
  for(int i=0; i < strs.length; ++i) {
    result[i] = Long.parseLong(strs[i]);
  }
  return result;
}
